import { v4 as uuidv4 } from 'uuid';

export const initialState = {
  program1: {
    id: uuidv4(),
    name: 'Program 1',
    program_duration: 0,
    duration_unit: '',
    days_per_week: 0,
    main_goal: ''
  },
  workouts: {
    workout1: {
      id: 'workout1',
      name: 'Workout 1',
      exercises: [],
      active: false,
      programId: 'program1'
    }
  },
  exercises: {
    'exercise-uuid-1': {
      id: 'exercise-uuid-1',
      name: 'Exercise 1',
      workoutId: 'workout-uuid-1'
    }
  },
  sets: {
    'set-uuid-1': {
      id: 'set-uuid-1',
      count: 10,
      weight: 50,
      exerciseId: 'exercise-uuid-1'
    }
  }
};
